import './button.css';

function Button(props) {
  return (
    <button className={`button ${props.buttonClassName}`}>
      <svg className={`button__icon ${props.buttonIconClassName}`} viewBox="0 0 16 16" fill={props.buttonIconFill} stroke="none" xmlns="http://www.w3.org/2000/svg">
        <path d={props.buttonIconPath} stroke="none"/>
      </svg>
      <div class="button__text">{props.buttonText}</div>
    </button>
  );
}

export default Button;
